import React from 'react'

export default function Table({headings,data}) {
  return (
    <table class="table table-hover">
    <thead>
      <tr>
          {headings.map((item)=>{
              return <th scope="col">{item}</th>

          })}
      </tr>
    </thead>
    <tbody>
        {
            data.map((item)=>{
                {Object.keys(item).map(function(key) {
                    return (
                        <td>{item[key]}</td>
                    )
                })}
            })
        }

    </tbody>
  </table>  )
}
